        // guesses.push(e.target.value);
        // console.log(guesses);
        e.preventDefault();
        // alert(`word entered was: ${candidate}`);
        console.log({candidate});
    }


    return (



            <form onSubmit={e => {handleSubmit(e)}}>
                    <label className="text">
                        Enter Word:
                        <input 
